import React from 'react';
import './App.css'; // Custom CSS file
import 'bootstrap/dist/css/bootstrap.min.css'; // Bootstrap CSS
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faShoppingCart, faList } from '@fortawesome/free-solid-svg-icons';

function Header() {
  return (
    <header className="header">
      <h1>Books Store</h1>
      <div>
        <span className="mr-3">Cart <FontAwesomeIcon icon={faShoppingCart} /></span>
        <span>Orders <FontAwesomeIcon icon={faList} /></span>
      </div>
    </header>
  );
}

function Footer() {
  return (
    <footer className="footer">
      <p>All rights reserved by Shankar</p>
    </footer>
  );
}

function App() {
  return (
    <div className="App">
      <Header />
      {/* Main Content Goes Here */}
      <Footer />
    </div>
  );
}

export default App;
